<template>
	<view class="recharge">
		<view class="recharge-title">
			充值金额
		</view>

		<view class="recharge-money">
			<view class="recharge-money-item" v-for="(item,index) in moneyList" :key="index"
				:class="activeIndex == index?'active':''" @click="selectMoney(index)">
				<view class="recharge-item-money">
					{{ item.money }}<span>元</span>
				</view>

				<view class="recharge-item-tip">
					仅供测试
				</view>
			</view>

		</view>

		<view class="recharge-title h-m-t-20">
			充值说明
		</view>
		<view class="recharge-tip">
			<view>1.充值所得金额仅该小程序可用。</view>
			<view>2.该充值功能未调用微信支付，点击充值即可。</view>
			<view>3.充值功能仅供功能测试使用。</view>
		</view>

		<view class="recharge-buttom-box">
			<view class="buttom-left">
				<view class="buttom-left-info">付款金额</view>
				<view class="buttom-left-money">¥ {{ moneyList[activeIndex].money }}</view>
			</view>

			<view class="buttom-right" @click="okEvent">
				立即充值
			</view>
		</view>

	</view>
</template>

<script>
	import {
		TOPUP
	} from '@/utils/api.js';
	import {
		request
	} from '@/utils/request.js';
	export default {
		data() {
			return {
				moneyList: [{
					'id': 0,
					'money': 100
				}, {
					'id': 1,
					'money': 200
				}, {
					'id': 2,
					'money': 300
				}, {
					'id': 3,
					'money': 400
				}],
				activeIndex: 0,
			};
		},
		methods: {
			/* 选择充值金额 */
			selectMoney(index) {
				this.activeIndex = index
			},
			okEvent() {
				const _this = this;
				uni.showToast({
					icon: 'none',
					title: '该平台仅供学习参考，不产生任何费用'
				});
				uni.showModal({
					title: '确认充值',
					success(res) {
						if (res.confirm) {
							request(TOPUP + "?balance=" + _this.moneyList[_this.activeIndex].money, 'POST').then((
								res) => {
								if (res.code === 200) {
									uni.navigateBack().then(() => {
										uni.showToast({
											icon: 'success',
											title: '充值成功'
										})
									})

								}
							})
						}
					}
				});
			}
		}
	}
</script>

